script: |
  super -f text -I q10529.spq | sort > q10529.out

inputs:
  - name: q10529.spq
    data: |
      SELECT DISTINCT - col0 AS col0, - 66 AS col2 FROM tab2 (FORMAT parquet) WHERE - ( - col2 ) <> 95;
  - name: tab2

outputs:
  - name: q10529.out
    data: |
      -46	-66
      -64	-66
      -75	-66
